import React from 'react';
import './URLinput.css'

const URLinput = () => {
	return(
		<div>
			<p>
				{'This App will detect faces in your pictures. Upload image URL below.'}
			</p>
			<div>
				<div className="form">
					<input type="text" placeholder="type URL here" />
					<button>Detect</button>
				</div>
			</div>
		</div>
	);
}

export default URLinput
